import styled from "styled-components";

const BgContact = styled.section`
  text-align: center;
  background-image: url("./img/Contact.png");
  background-size: cover;
  position: relative;
  padding-top: 100px;
`

const Contact = () => {
    return(
        <BgContact>
            <div className={'container'}>
            </div>
        </BgContact>
    );
}

export default Contact;
